(, 'Parthasarathy Temple', 'Chennai', 'Tamil Nadu', 'The Parthasarathy Temple is an 8th-century Hindu Vaishnavite temple dedicated to the god Krishna, located at Triplicane, Chennai, India. The temple is glorified in the Divya Prabandha, the early medieval Tamil literature canon of the Alvar saints from the 6th–9th centuries CE and is classified as among the 108 Divya Desams dedicated to Vishnu. The name ''Parthasarathy'', in Sanskrit, means the ''charioteer of Arjuna'', referring to Krishna''s role as a charioteer to Arjuna in the epic Mahabaratha.', '', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3886.7135920462406!2d80.27481705050556!3d13.053893816553797!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3a52689dfe1e93a1%3A0xaa50bb6e69dbeb20!2sParthasarathi+Temple!5e0!3m2!1sen!2sin!4v1490978814595', 'divine', 2);
