(, 'Kapaleeswarar Temple', 'Chennai', 'Tamil Nadu', 'Kapaleeshwarar Temple, Mylapore, Chennai is a temple of Shiva located in Mylapore, Chennai in the Indian state of Tamil Nadu. The form of Shiva''s consort Parvati worshipped at this temple is called Karpagambal is from Tamil, ("Goddess of the Wish-Yielding Tree"). The temple was built around the 7th century CE in Dravidian architecture. According to the Puranas, Shakti worshipped Shiva in the form of a peacock, giving the vernacular name Mylai (Mayil?i) to the area that developed around the temple - mayil is Tamil for "peacock". Shiva is worshiped as Kapaleeswarar, and is represented by the lingam. His consort Parvati is depicted as Karpagambal. ', 'https://www.google.co.in/maps/place/Arulmigu+Kapaleeswarar+Temple/@13.0338831,80.2700958,3a,75y,65.22h,91.81t/data=!3m8!1e1!3m6!1s-nv2kmCS8Lik%2FV9lJA_7sXNI%2FAAAAAAAAJfE%2FuUOqBhy3YTIXUV02bvETswPle8vb2BHcQCJkC!2e4!3e11!6s%2F%2Flh5.googleusercontent.com%2F-nv2kmCS8Lik%2FV9lJA_7sXNI%2FAAAAAAAAJfE%2FuUOqBhy3YTIXUV02bvETswPle8vb2BHcQCJkC%2Fw234-h106-k-no-pi-2.9999962-ya225.50002-ro-0-fo100%2F!7i7168!8i3584!4m5!3m4!1s0x3a5267d375583167:0x1cb31c36b00e50e2!8m2!3d13.0336342!4d80.2701988!6m1!1e1', 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d4135.03253111119!2d80.26800475050545!3d13.033639416995085!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3a5267d375583167%3A0x1cb31c36b00e50e2!2sArulmigu+Kapaleeswarar+Temple!5e1!3m2!1sen!2sin!4v1490978635029', 'divine', 3);

